[election_results]
results_file=<path to results file, relative to results_dir specified in run_time.ini>
munger_list=<comma-separated list of all mungers to be applied to the file.>
jurisdiction=<internal db name from ReportingUnit table>
election=<internal db name from Election table or Election.txt>
results_short_name=<short_name from the db _datafile table>
results_download_date=<date file was downloaded from the source, format YYYY-MM-DD, e.g., 2020-05-19>
results_source=<usually the State Board of Elections>
results_note=
is_preliminary=<True or False -- for an official file, False>


